/*Table structure for table `clasificaciones_camas` */

DROP TABLE IF EXISTS `clasificaciones_camas`;

CREATE TABLE `clasificaciones_camas` (
  `id_clasificacion_cama` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `clasificacion_cama` varchar(50) NOT NULL COMMENT 'Descripcion de la clasificacion',
  `abreviatura` char(5) NOT NULL COMMENT 'Abreviatura de la descripcion',
  `definicion` text COMMENT 'Informacion extra',
  `tipo_cuidado_progresivo` tinyint(3) unsigned NOT NULL COMMENT '0= cuidado moderado; 1= cuidado intermedio ; 2=cuidado critico',
  `critica` tinyint(1) unsigned NOT NULL COMMENT '0= no critica; 1= critica',
  `categoria_edad` char(3) NOT NULL COMMENT 'ADU= adulto (>14 a); PED= pediatrica (>28 d y <14 a); NEO= neonatologica (<28 d)',
  `fecha_expiracion` date DEFAULT NULL COMMENT 'Fecha de baja de la clasificacion',
  `oxigeno` tinyint(3) NOT NULL COMMENT '0=sin ogigeno ; 1=con oxigeno',
  `respirador` tinyint(1) unsigned NOT NULL COMMENT '0= sin respirador; 1= con respirador',
  `aislamiento` tinyint(1) unsigned NOT NULL COMMENT '0= sin aislamiento; 1= con aislamiento (casos donde el paciente debe estar aislado de los otros por el tipo de efermedad)',
  PRIMARY KEY (`id_clasificacion_cama`),
  UNIQUE KEY `idx_unique_clasificacion_cama` (`clasificacion_cama`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1 COMMENT='tipos de cama propuestos por Stettler y compatibles con sisa';

