		END IF;
			
	END LOOP;
		
	CLOSE restricciones_operaciones_sub;
	
	
	
	/* ------------------- */
	/* busca a nivel grupo */
	/* ------------------- */
	
	SET exit_loop = 0;
		
	OPEN restricciones_operaciones_gru;
		
	bucle_gru:
	LOOP
	
		FETCH 
