			/* 3 = puede o no tener operacion */
			/* 4 = obliga operacion si datos RN */
			RETURN restriccion_operacion_aux;
			
		END IF;
		
			
	END LOOP;
		
	CLOSE restricciones_operaciones_gru;
	
	
	
	/* ---------------------- */
